export default function (req, res) {
  if (req.method != "POST") {
    return res.status(405).end();
  }
  const {
    laaneBelop,
    nominellRente,
    terminGebyr,
    utlopsDato,
    saldoDato,
    datoForsteInnbetaling,
    ukjentVerdi,
  } = req.body;
  const t = {dato: hey}
  res.status(200).json(t);
}
